import React, { useEffect, useState } from "react";
import { Link, navigate } from "@reach/router";
import Header from "../components/Header";
import WorkoutForm from "../components/WorkoutForm";

const Main = () => {
  const [pirates, setPirates] = useState([]);

  useEffect(() => {}, []);

  return (
    <div>
      <Header />
      <WorkoutForm />
      {pirates.map((pirate, idx) => {
        return (
          <div key={idx} className="pirate-info">
            <div className="main-image">
              <img src={pirate.imageUrl} alt={pirate.name} />
            </div>

            <div className="pirate-main">
              <h2>{pirate.name}</h2>
              <div className="main-buttons">
                <button
                  className="view-pirate"
                  onClick={(e) => navigate("/pirate/" + pirate._id)}
                >
                  View Pirate
                </button>
                <button className="delete-pirate">Walk the Plank</button>
              </div>
            </div>
          </div>
        );
      })}
    </div>
  );
};

export default Main;
